import React from "react";
import { Box, Typography, TextField, Button, Paper, Link } from "@mui/material";
import { useForm } from "react-hook-form";
import { useDispatch, useSelector } from "react-redux";
import axios from "axios";
import { RequestLogin } from "../../../../store/AxiosLibrary";

const Login = () => {
  //Handle form (react-hook-form)

  // const dispatch = useDispatch();
  // const responseLogin = useSelector((state) => state);
  // console.log(responseLogin);
  const {
    register,
    handleSubmit,
    formState: { errors },
  } = useForm();

  const onSubmit = (data) => {
    // const url = "http://localhost:5000/api/auth/login";
    // axios.post(url,data).then(res=>console.log(res))
    // console.log(data)
    RequestLogin(data)
  };

  return (
    <Box className="LoginForm">
      <Box className="form">
        <Typography variant="h5" className="loginText">
          Login
        </Typography>
        <form onSubmit={handleSubmit(onSubmit)}>
          <Box className="coverTextField">
            <TextField
              id="standard-basic"
              label="Email"
              variant="outlined"
              className="inputLogin"
              defaultValue=""
              fullWidth
              {...register("email")}
              // error="true"
              // helperText="this is error"
            />
          </Box>
          <Box className="coverTextField">
            <TextField
              id="standard-basic"
              label="Password"
              variant="outlined"
              type="password"
              className="inputLogin"
              defaultValue=""
              fullWidth
              {...register("password")}
              // error="true"
              // helperText="this is error"
            />
          </Box>
          <Button
            variant="contained"
            className="buttonLogin"
            type="submit"
          >
            Log In
          </Button>
          <br></br>
          <Typography variant="p" className="registerText">
            Do you have account ?
            <Link href="/signup" className="registerLink">
              Sign up
            </Link>
          </Typography>
        </form>
      </Box>
    </Box>
  );
};

export default Login;
